<div class="meta"><div class="byline">By <a href="https://www.dailynews.com/author/abby-hamblin/" title="Posts by Abby Hamblin" class=" author-name" rel="author">Abby Hamblin</a> | <a href="mailto:ahamblin@scng.com">ahamblin@scng.com</a> | </div><div class="time">PUBLISHED: <time datetime="2022-03-25 21:16:06">March 25, 2022 at 9:16 p.m.</time> | UPDATED: <time class="updated" datetime="2022-03-26 09:50:35">March 26, 2022 at 9:50 a.m.</time></div></div></div><div class="article-body"><div class="body-copy"><p>The loss of Foo Fighters drummer Taylor Hawkins has shocked and saddened the world of Rock music.</p>
<p>The drummer’s death was <a href="https://www.ocregister.com/2022/03/25/taylor-hawkins-of-foo-fighters-dead-at-50/">announced in a statement</a> from the band on Friday night, saying his “musical spirit and infectious laughter will live on with all of us forever.”</p>
